import { commercial } from "../../constants";
import {
  En_Hero,
  En_Overall,
  Full_Middle,
  Middle_Image,
  Padding_Middle,
  Specs,
  Studios,
} from "../Portal";

const Commercial = () => {
  return (
    <>
      <En_Hero
        prod={commercial}
        title="Commercial Energy"
        get={commercial.getLink}
      />
      <section>
        <img
          src={commercial.controlCenter}
          alt="Control-Center"
          className="bg-fullobject w-full h-[70vh]"
        />
      </section>
    </>
  );
};

export default Commercial;
